import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    factBox: {
        position: 'absolute',
        right: 10,
        bottom: 10,
        width: '50%',
        height: '30%',
        backgroundColor: 'white',
        padding: 22,
        borderRadius: 4,
        borderColor: 'rgba(0, 0, 0, 0.1)'
    },
});
